/** @format */

import React from 'react';
import profile from '../images/profile.png';
import './CV.css';
import { CVDesc, CVApproach } from './TextInfo';

const CV = () => {
	return (
		<div className='container_CV'>
			<h1 className='title'>Executive Chef Yannick</h1>
			<span className='cv_info'>
				<span className='desc'>
					<img className='profile_pic' src={profile} alt='Yannick' />
					<span className='desc_text'>
						{CVDesc.map((item, index) => {
							return <p>{item.text}</p>;
						})}
					</span>
				</span>
				<span className='approach'>
					<h1 className='subtitle'>Working Approach</h1>
					<ul className='work_li'>
						<li>
							Client first, understand the objectives, core values and vision of
							the company.
						</li>
						<li>
							Adhere & follow the principle of think, do, measure, correct &
							improve continuously.
						</li>
						<li>
							Result-oriented, adopt actions to circumstances to obtain the best
							possible result.
						</li>
						<li>
							Create a dynamic structure in the kitchen, products, quality
							process & resources.
						</li>
						<li>
							Hands-on, coach & lead a team with detail minded / team building /
							training and budget targets.
						</li>
					</ul>
				</span>
			</span>
		</div>
	);
};

export default CV;
